import React, { useState } from 'react';
import axios from 'axios';
import { Link } from '@reach/router';


function Starwars() {
    const [starwars, setStarwars] = useState([])
    var type = 'type'.val();

    function getStarwars() {
        axios.get('https://swapi.co/api/'+ type)
        .then(response => setStarwars([...response.data.results]))
        .catch(err => console.log(err))
    }

    console.log("starwars results are: ",starwars);

    return (
        <div>
            <h1>Search for: </h1>
            <select>
                <option>People</option>
                <option>Planets</option>
                <option>Films</option>
                <option>Species</option>
                <option>Starships</option>
            </select>
            <button onClick={getStarwars}>Search</button>
            {starwars.map((el,i) =>
            <p key={i}>{el.name}, {el.height}, {el.birth_year}</p>
            )}
        </div>
    )
}

export default Starwars
